/*===Put imports here===*/
import React from "react";
import jsPDF from "jspdf";
/*===Start code here===*/
let CIE =
  "data:image/jpeg;base64,";
let BAR =
  "data:image/jpeg;base64,";
let HAV =
  "data:image/jpeg;base64,";
let SCU =
  "data:image/jpeg;base64,";
let VIN =
  "data:image/jpeg;base64,";

const createPDF = (globalTrip) => {
  var doc = new jsPDF();
  //let dataPDF = globalTrip.globalTrip;
  globalTrip.globalTrip.map((item, i) => {
    let somVar;
    if (item.identifier == "HAV") somVar = HAV;
    if (item.identifier == "VIN") somVar = VIN;
    if (item.identifier == "CIE") somVar = CIE;
    if (item.identifier == "SCU") somVar = SCU;
    if (item.identifier == "BAR") somVar = BAR;

    if (i == 0) {
      return (
        doc.text(80, 10, "Your Travel Itinerary"),
        doc.addImage(somVar, "JPEG", 20, 20, 40, 30),
        doc.text(80, 30, i + 1 + "." + item.name),
        doc.text(80, 40, "from: " + item.fromDeutsch),
        doc.text(80, 50, "to: " + item.toDeutsch)
      );
    } else if (i == 7 || i == 14 || i == 21 || i == 28) {
      return (
        doc.addImage(somVar, "JPEG", 20, 20, 40, 30),
        doc.text(80, 30, i + 1 + "." + item.name),
        doc.text(80, 40, "from: " + item.fromDeutsch),
        doc.text(80, 50, "to: " + item.toDeutsch)
      );
    } else if (i == 1 || i == 8 || i == 15 || i == 22 || i == 29) {
      return (
        doc.addImage(somVar, "JPEG", 20, 60, 40, 30),
        doc.text(80, 70, i + 1 + "." + item.name),
        doc.text(80, 80, "from: " + item.fromDeutsch),
        doc.text(80, 90, "to: " + item.toDeutsch)
      );
    } else if (i == 2 || i == 9 || i == 16 || i == 23 || i == 30) {
      return (
        doc.addImage(somVar, "JPEG", 20, 100, 40, 30),
        doc.text(80, 110, i + 1 + "." + item.name),
        doc.text(80, 120, "from: " + item.fromDeutsch),
        doc.text(80, 130, "to: " + item.toDeutsch)
      );
    } else if (i == 3 || i == 10 || i == 17 || i == 24 || i == 31) {
      return (
        doc.addImage(somVar, "JPEG", 20, 140, 40, 30),
        doc.text(80, 150, i + 1 + "." + item.name),
        doc.text(80, 160, "from: " + item.fromDeutsch),
        doc.text(80, 170, "to: " + item.toDeutsch)
      );
    } else if (i == 4 || i == 11 || i == 18 || i == 25 || i == 32) {
      return (
        doc.addImage(somVar, "JPEG", 20, 180, 40, 30),
        doc.text(80, 190, i + 1 + "." + item.name),
        doc.text(80, 200, "from: " + item.fromDeutsch),
        doc.text(80, 210, "to: " + item.toDeutsch)
      );
    } else if (i == 5 || i == 12 || i == 19 || i == 26 || i == 33) {
      return (
        doc.addImage(somVar, "JPEG", 20, 220, 40, 30),
        doc.text(80, 230, i + 1 + "." + item.name),
        doc.text(80, 240, "from: " + item.fromDeutsch),
        doc.text(80, 250, "to: " + item.toDeutsch)
      );
    } else if (i == 6 || i == 13 || i == 20 || i == 27 || i == 34) {
      return (
        doc.addImage(somVar, "JPEG", 20, 260, 40, 30),
        doc.text(80, 270, i + 1 + "." + item.name),
        doc.text(80, 280, "from: " + item.fromDeutsch),
        doc.text(80, 290, "to: " + item.toDeutsch),
        doc.addPage()
      );
    }
  });
  //console.log("this is somVar", somVar);

  doc.save("MyCubaTrip.pdf");
};

export default function PDFCreator(globalTrip) {
  console.log(globalTrip);
  if (globalTrip.globalTrip.length >= 1) {
    return <button onClick={() => createPDF(globalTrip)}>Save as PDF</button>;
  } else {
    return "";
  }
}

